DROP TABLE  SG_LOG;
CREATE TABLE  SG_LOG  ( 
	LOG_ID         	VARCHAR(255) NOT NULL,
	LOG_USER_ID    	VARCHAR(255) NOT NULL,
	LOG_FUNCTION_ID	VARCHAR(255) NOT NULL,
	LOG_TIME       	TIMESTAMP NOT NULL,
	LOG_DETAIL     	VARCHAR(255) NOT NULL,
	LOG_TYPE       	VARCHAR(255) NOT NULL 
	)
;
COMMENT ON TABLE  SG_LOG IS '日志信息表'
;
COMMENT ON COLUMN  SG_LOG.LOG_ID IS 'ID'
;
COMMENT ON COLUMN  SG_LOG.LOG_USER_ID IS '用户ID'
;
COMMENT ON COLUMN  SG_LOG.LOG_FUNCTION_ID IS '菜单ID'
;
COMMENT ON COLUMN  SG_LOG.LOG_TIME IS '记录时间'
;
COMMENT ON COLUMN  SG_LOG.LOG_DETAIL IS '日志内容详情'
;
COMMENT ON COLUMN  SG_LOG.LOG_TYPE IS '类型'
;
